import styled from "styled-components";
import { useSelector, useDispatch } from "react-redux";

const TodoBox = styled.div`
  max-width: 1150px;
  background-color: white;
  margin: auto;
  border: 1px solid transparent;
  border-radius: 10px;
`;

const Todo = () => {
  const done = useSelector((state) => state);
  console.log(done);
  return (
    <div>
      <TodoBox>
        <div>title</div>
        <div>content</div>
        <button>완료</button>
        <button>삭제</button>
      </TodoBox>
    </div>
  );
};

export default Todo;
